import { sequelize } from '../database/database';
// import Usuario from './usuario.model';
const Usuariosubmenu = sequelize.define('usuariosubmenu', {
    id: {
        type: Sequelize.INTEGER,
        autoIncrement: true
    },
    usuarioid: {
        type: Sequelize.INTEGER,
        primaryKey: true,
        foreingKey: true,
        references: {
            model: 'Usuario',
            key: 'usuarioid'
        }
    },
    submenuid: {
        type: Sequelize.INTEGER,
        primaryKey: true,
        foreingKey: true,
        references: {
            model: 'Submenu',
            key: 'submenuid'
        }
    }
}, {
    freezeTableName: true,
    timestamps: false
});


